import React, { useEffect, useState } from 'react'

function Post() {
  const API_URL = "http://localhost:3001";
  const [gameList, setGameList] = useState([]);

  useEffect(() => {
    fetch(`${API_URL}/posts`, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(async (res) => {
        try {
          const data = await res.json()
          console.log('response data?', data)
        } catch (error) {
          console.log('error!')
          console.error(error)
        }
      })
      // .then((data) => {
      //   console.log(data)
      //   setGameList(data)
      // });
  }, []);

  return (
    <>
      {gameList.map((v, i) => {
        return (
          <div>
            <h3>{v.title}</h3>
          </div>
        )
      })}
    </>
  )
}

export default Post
